  src_proto_path:
  - /tmp/input/google/example/library/v1
  test_proto_deps:
  - name: google-iam-v1
    proto_path: google/iam/v1
php:
  gapic_code_dir: /tmp/output/php/google-cloud-library-v1
  release_level: ga
